How it works (iOS)
The animation is executed by creating a number of snapshots (using snapshotViewAfterScreenUpdates ) and animating them inside of an animation container
using a UIViewControllerTransitioningDelegate
The snapshot itself is several steps, as outlined below. Provided you have the following three inputs:

fromViewController: The view controller you are navigating away from
toViewController: The view controller you are navigating to
transitionGroup: the id of the transition group in the fromViewController that is going to be involved in the transition.

With those parameters, we do the following:

Snapshot fromViewController and put the snapshot on top of the view hierarchy to cover the screen
In fromViewController collect snapshots of every SharedElement inside of the SharedElementGroup with id matching transitionGroup.
Snapshot the entire fromViewController view hierarchy with each SharedElement from #2 having alpha set to 0.
In toViewController collect snapshots of every SharedElement.
Snapshot the entire toViewController view hierarchy with each SharedElement from #4 having alpha set to 0.
Find all of the matching SharedElements in toViewController and fromViewController, matching by typeId etc.
Remove snapshot from #1. Insert snapshots into the animation container in the following order:
full screen snapshot of fromViewController minus shared elements 
all shared elements from fromViewController without a match
full screen snapshot of toViewController minus shared elements (set alpha to 0)
all shared elements from toViewController without a match (set alpha to 0)
all shared elements from fromViewController with matches in toViewController


Execute a UIView.animateWithDuration(...) and set the following things in the animation:
full screen snapshot of toViewController minus shared elements (set alpha to 1)
all shared elements from toViewController without a match (set alpha to 1)
all shared elements from fromViewController with matches in toViewController:
set .center to the .center of the corresponding matched element
set .transform to be an XY scale transform that matches the ratio of the widths/heights of the element relative to its matched pair.




On completion of animation, remove the animation container completely.

